import React from 'react';
import './About.css'; // Link to your CSS file

// Resume data
const resumeData = {
  introduction: {
    name: "Your Name",
    title: "Your Professional Title",
    summary: "A brief summary of your professional background and goals."
  },
  skills: [
    "Skill 1",
    "Skill 2",
    "Skill 3",
    "Skill 4"
  ],
  experience: [
    {
      jobTitle: "Job Title 1",
      company: "Company 1",
      dates: "Start Date - End Date",
      description: "Brief description of your responsibilities and achievements."
    },
    {
      jobTitle: "Job Title 2",
      company: "Company 2",
      dates: "Start Date - End Date",
      description: "Brief description of your responsibilities and achievements."
    }
  ],
  education: [
    {
      degree: "Degree",
      institution: "Institution",
      dates: "Start Date - End Date",
      description: "Brief description or honors."
    }
  ]
};

function Resume() {
  return (
    <section id="resume" className="resume">
      <div className="intro">
        <h1>{resumeData.introduction.name}</h1>
        <h2>{resumeData.introduction.title}</h2>
        <p>{resumeData.introduction.summary}</p>
      </div>
      <div className="skills">
        <h2>Skills</h2>
        <ul>
          {resumeData.skills.map((skill, index) => (
            <li key={index}>{skill}</li>
          ))}
        </ul>
      </div>
      <div className="experience">
        <h2>Experience</h2>
        {resumeData.experience.map((exp, index) => (
          <div key={index} className="experience-item">
            <h3>{exp.jobTitle} at {exp.company}</h3>
            <p><strong>{exp.dates}</strong></p>
            <p>{exp.description}</p>
          </div>
        ))}
      </div>
      <div className="education">
        <h2>Education</h2>
        {resumeData.education.map((edu, index) => (
          <div key={index} className="education-item">
            <h3>{edu.degree} from {edu.institution}</h3>
            <p><strong>{edu.dates}</strong></p>
            <p>{edu.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Resume;
